  const fetchdata = () => {
    fetch("https://randomuser.me/api/?results=1")
    .then(Response => Response.json())
    .then(data => setUser(data))
  }

  useEffect(() => {
    fetchdata();
  }, [])

  return Object.keys(user).length > 0 ? (
    <div>

    </div>) : 
    (<div>
        <h1> Data Pending...</h1>
    </div>)
}
 export default App;
